import React from "react";

const Navigation = () => {
  let nav =
    "menu d-flex text-uppercase fw-bold justify-content-between text-decoration-none list-inline flex-row justify-content-evenly";
  return (
    <nav className=" dechirer container-fluid ">
      <div className="container d-flex justify-content-between">
        <div className="logo">
          <img className="myLogo" src="../images/logo.png" />
        </div>

        <div>
          <ul className={nav}>
            <li className="list-group">Home</li>
            <li>Menu</li>
            <li>Our Story</li>
            <li>Contact us</li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
